(function() {

	angular

	.module('Demos', [
		'ngclipboard'
		])

	.config(['$routeProvider', function($routeProvider) {
		$routeProvider.when('/demos', {
			templateUrl : 'templates/demos.html',
			controller: 'demosCtrl'
		});
	}])

	.controller('demosCtrl', ['$rootScope', '$scope', '$q', '$http', '$timeout', function($rootScope, $scope, $q, $http, $timeout) {

		// assume the faucet is ON by default
		$scope.faucetOff = false;

		// clear any blocks upon page refresh
		delete $rootScope.block;

		// define the different button states
  		var button = {

  			default: {
  				disabled: false,
  				icon: 'play',
  				title: 'Simulate Payment',
  				class: 'blue'
  			},

  			paying: {
  				disabled: true,
  				icon: 'loading spinner',
  				title: 'Paying',
  				class: 'grey'
  			}
  		};

  		// set default button state
  		$scope.button = button.default;

  		// simulate real payment
  		$scope.simulatePayment = function () {

  			// 'paying' status
			$scope.button = button.paying;

			$http.post('/demo').success(function(data) {

				if(data.statusCode === 200) {
					$scope.paid = true;
					$scope.account = null;
					$scope.button = button.default;
				} else {
					$scope.button = button[data.message];
					$timeout(function() {
						$scope.account = null;
						$scope.button = button.default;
					}, 3000);
				}
			})
			.error(function(data, status) {
				console.error('Error', status, data);
			});
		}

		$scope.paymentBegin = function() {

			return $q(function(resolve, reject) {
				io.socket.post('/paymentBegin', function (data, jwres) {
					if(data.statusCode === 400) {
						$scope.faucetOff = true;
					} else {
						$scope.payment_account = data.account;
					}
					$scope.$apply();
					resolve();
				});
			});

			return promise;
		}

		$scope.paymentWait = function() {
			
			return $q(function(resolve, reject) {

				io.socket.post('/paymentWait', function (data, jwres) {

					$scope.paid = data.response.paid;

					// NOT PAID
					if(data.response.paid === false) {
						$scope.paymentWait();
					} 
					// PAID
					else if(data.response.paid === true) {
						$scope.paymentFinish(data.account);
					}
					$scope.$apply();
					resolve();
				});
			});

			return promise;
		}

		$scope.paymentFinish = function(account) {

			$scope.payment_account = undefined;
			io.socket.post('/paymentFinish', { account: account });
		}

		$scope.initialize = function(bool) {

			// start demo
			if(bool) {
				$scope.initialized = true; // triggers showing of demo itself. only reset on refresh or demo "quit"
				$scope.payment_account = undefined; // no payment account by default
				$scope.paid = false; // not paid by default
				$scope.paymentBegin().then(function() {
					$scope.paymentWait();
				});
			} 
			// read again
			else {
				$scope.payment_account = undefined;
				$scope.initialized = false;
				$scope.paid = false;
			}
		}
	}]);

})();
(function() {

	angular

	.module('Distribution', [
		'ngclipboard'
		])

	.config(['$routeProvider', function($routeProvider) {
		$routeProvider.when('/distribution', {
			templateUrl : 'templates/distribution.html',
			controller: 'distributionCtrl'
		});
	}])

	.controller('distributionCtrl', ['$rootScope', '$filter', '$interval', '$scope', '$http', '$timeout', '$location', 'vcRecaptchaService', function($rootScope, $filter, $interval, $scope, $http, $timeout, $location, vcRecaptchaService) {

		$scope.howFaucet = function(bool) {
			if(bool) {
				$('#how-faucet').modal('show');
			} else {
				$('#how-faucet').modal('hide');
			}
		}

		$scope.requestSuccess = false;

		// fetch the available supply
		io.socket.get('/api/available_supply', function (resData, jwres){

			$scope.available_supply_absolute = resData;
			var percentage_distributed = resData / $rootScope.total_faucet * 100;
			$scope.percentage_distributed = $filter('number')(percentage_distributed, 3);

			$scope.$apply();
			$('#distributed_perc').progress({
				showActivity: false,
				percent: $scope.percentage_distributed
			});
		});

		$scope.init = function () {
			$scope.response = null;
			$scope.widgetId = null;
		}

		$scope.init();
		
		$scope.setResponse = function (response) {
			$scope.response = response;
		};

		$scope.setWidgetId = function (widgetId) {
			$scope.widgetId = widgetId;
		};

  		// define the different button states
  		var button = {

  			default: {
  				disabled: false,
  				icon: 'add circle',
  				title: 'Request',
  				class: 'blue'
  			},

  			queued: {
  				disabled: true,
  				icon: 'loading spinner',
  				title: 'Queued',
  				class: 'grey'
  			},

  			success: {
  				disabled: true,
  				icon: 'thumbs up',
  				title: 'Success',
  				class: 'green'
  			},

  			account_error: {
  				disabled: true,
  				icon: 'thumbs down',
  				title: 'Invalid account',
  				class: 'red'
  			},

  			recaptcha_error: {
  				disabled: true,
  				icon: 'thumbs down',
  				title: 'Incomplete reCaptcha',
  				class: 'red'
  			},

  			faucetoff: {
  				disabled: true,
  				icon: 'warning sign',
  				title: 'Faucet is off',
  				class: 'red'
  			},

  			try_again: {
  				disabled: true,
  				icon: 'warning sign',
  				title: 'Try again',
  				class: 'orange'
  			},

  			server_error: {
  				disabled: true,
  				icon: 'warning sign',
  				title: 'Server error',
  				class: 'red'
  			}
  		};

  		//$scope.button = button.faucetoff;
		$scope.button = button.default;

  		$scope.validateAccount = function() {
  			if($scope.account === undefined || $scope.account === null || $scope.account === '' || $scope.account.lastIndexOf('xrb_', 0) !== 0) {
  				$scope.button = button.account_error;
  				return false;
  			} else {
  				return true;
  			}
  		}
  		$scope.validateResponse = function() {
  			if($scope.response === undefined || $scope.response === null || $scope.response === '') {
  				$scope.button = button.recaptcha_error;
  				return false;
  			} else {
  				return true;
  			}
  		}
  		$scope.validateForm = function() {
  			if($scope.validateAccount()) {
  				if($scope.validateResponse()) {
  					return true;
  				} else {
  					return false;
  				}
  			} else {
  				return false;
  			}
  		}

		// submit form, triggers validateForm(), which triggers validateAccount() and validateResponse()
		$scope.submit = function () {

			if($scope.validateForm()) {

				// mark request as queued
				$scope.button = button.queued;

				// create a payload
				this.payload = {
					account: $scope.account,
					response: $scope.response,
					_csrf: $rootScope._csrf
				};
				
				// deliver the payload
				$http.post('/distribution', this.payload).success(function(data) {
				
					if(data.message === 'success') {

						// clear recaptcha for re-use right-away so front-end exploiters have no advantage against regular users.
						vcRecaptchaService.reload($scope.widgetId);						
						$scope.init();

						// display success button very briefly so front-end exploiters have no incentive to disable this. (purely for UX)
						$scope.button = button.success;
						$timeout(function() {
							$scope.button = button.default;
						}, 1000);

						// store my current distribution
						var CD = data.current_distribution;

						// update $scope with the current distribution
						currDist = function() {
							$scope.current_distribution = CD;
						}

						// this only happens if there is no DistributionTracker record yet
						// that can happen for 1 minute after payouts.
						if(data.no_records) {
							$scope.no_records = true;
						} else {
							$scope.no_records = false;
						}

						// store my past distributions every time. 
						// this historical data does not change like our
						// realtime current distribution does.
						if(data.past_distributions) {
							$scope.past_distributions = data.past_distributions;
						}

						// new visitor with data, set current_distributions $scope
						if(!$scope.current_distribution) {

							// set data if it exists
							if(CD) {
								currDist();
							}

							// no data yet, create a new payload.
							else {
								$scope.current_distribution = {};
								$scope.current_distribution.total_count = 0;
							}
						} 

						// returning visitor, $scope.current_distribution is set.
						else {

							// if there is no current_distribution data, payouts must have just happened.
							if(!CD) {

								// first time this will run
								if(!$scope.current_distribution.waiting) {
									$scope.current_distribution = {};
									$scope.current_distribution.waiting = true; // this makes this section run once.
									$scope.current_distribution.total_count = 0;
								}

							} else {

								// if the server payload is more up-to-date...
								// then the distribution period must have just ended.
								if(CD.started_unix > $scope.current_distribution.started_unix) {
									currDist();
								}

								// if my total count on the server is more up-to-date...
								if(CD.total_count > $scope.current_distribution.total_count || !$scope.current_distribution.total_count) {
									currDist();
								}
								// if the complete count on the server is more up-to-date...
								if(CD.complete_count > $scope.current_distribution.complete_count || !$scope.current_distribution.complete_count) {
									currDist();
								}

								// if the account they are submitting is different, update the payload.
								if($scope.account !== $scope.lastAccount) {
									currDist();
								}
							}
						}

						// increase my count
						$scope.current_distribution.total_count++;

						// save the account we're submitting to see if it changes.
						$scope.lastAccount = $scope.account;

						// activate popups
						$('.popup').popup();
					}

					// non-success
					else { 
						$scope.button = button[data.message];
						$timeout(function() {
							vcRecaptchaService.reload($scope.widgetId);
							$scope.init();
							$scope.button = button.default;
						}, 1000);
					}
				})
				.error(function(data, status) {
					console.error('Error', status, data);
				});

			} else {
				$timeout(function() {
					vcRecaptchaService.reload($scope.widgetId);
					$scope.init();
					$scope.button = button.default;
				}, 3000);
			}
		}
	}]);

})();
(function() {

	angular

	.module('Explorer', [])

   .config(['$routeProvider', function($routeProvider) {
		$routeProvider.when('/explorer', {
			templateUrl : 'templates/explorer.html',
			controller: 'explorerCtrl'
		});
	}])

	.controller('explorerCtrl', ['$rootScope', '$scope', '$q', '$timeout', function($rootScope, $scope, $q, $timeout) {

      // fetch the current block count
      io.socket.get('/api/block_count', function (resData, jwres){
         $scope.block_count = resData;
         $scope.$apply();
      });

      // define the different button states
      var button = {

         default: {
            disabled: false,
            icon: 'search',
            title: 'Explore',
            class: 'blue'
         },

         exploring: {
            disabled: true,
            icon: 'loading spinner',
            title: 'Exploring',
            class: 'grey'
         },

         explored: {
            disabled: true,
            icon: 'thumbs up',
            title: 'Explored',
            class: 'green'
         },

         invalid_hash: {
            disabled: true,
            icon: 'thumbs down',
            title: 'Invalid hash',
            class: 'red'
         },

         no_hash: {
            disabled: true,
            icon: 'thumbs down',
            title: 'No hash',
            class: 'red'
         },

         missing_block: {
            disabled: true,
            icon: 'thumbs down',
            title: 'Block missing',
            class: 'red'
         }
      };

      $scope.newSearch = function() {

         $scope.button = button.default;
         delete $scope.response;
         delete $scope.hash;
         $scope.submitted = false;
      }

      $scope.newSearch();

      responseTemplate = {
         type: {
            icon: 'tags'
         },
         previous: {
            icon: 'long arrow left'
         },
         destination: {
            icon: 'bullseye'
         },
         balance: {
            icon: 'resize horizontal'
         },
         work: {
            icon: 'suitcase'
         },
         signature: {
            icon: 'write'
         },
         source: {
            icon: 'sun'
         },
         representative: {
            icon: 'clone'
         },
         account: {
            icon: 'university'
         }
      };

      // explore a specific block chain hash    
      $scope.explore = function() {

         return $q(function(resolve, reject) {

            $scope.response = JSON.parse(JSON.stringify(responseTemplate));

            if($scope.hash) {

               $scope.button = button.exploring;
               
               io.socket.post('/blockExplorer', { hash: $scope.hash, _csrf: $rootScope._csrf }, function (data, jwres) {

                  // fail
                  if(data.statusCode === 400) {

                     if(data.response === 'Bad hash number') {

                        $scope.button = button.invalid_hash;
                        $scope.$apply();

                        $timeout(function() {
                           $scope.button = button.default;
                           $scope.$apply();
                           resolve();
                        }, 3000);
                     } else if(data.response === 'Block not found') {

                        $scope.button = button.missing_block;
                        $scope.$apply();

                        $timeout(function() {
                           $scope.button = button.default;
                           $scope.$apply();
                           resolve();
                        }, 3000);
                     }
                  }

                  // success
                  else if(data.statusCode === 200) {

                     // convert string json to object
                     contents = JSON.parse(data.response.contents);

                     // iterate through each item in the object and store the value
                     angular.forEach(contents, function(val, key) {
                        $scope.response[key].value = val;
                     });

                     // remove any unnecessary keys
                     angular.forEach($scope.response, function(obj, key) {
                        if(!obj.value) {
                           delete $scope.response[key];
                        }
                     });

                    $scope.button = button.explored;
                    $scope.submitted = true;
                    $scope.$apply();

                    $timeout(function() {
                        $scope.button = button.default;
                        $scope.$apply();
                        resolve();
                     }, 3000);
                  }
               });
            }
         });

         return promise;
      }

      // if a block hash is set from a free rai form completion, explore automatically
      if($rootScope.block) {
         $scope.hash = $rootScope.block;
         $scope.explore();
      }

   }]);

})();
